import React from 'react';
import { NavLink } from 'react-router-dom';
import classes from './Navbar.module.css';
import { connect } from 'react-redux';
import NavigationItem from '../NavigationItems/NavigationItem/NavigationItem';
import * as actionTypes from '../../../store/actions/actionTypes';

class Navbar extends React.Component {

    logOut() {
        this.props.history.push('/');
        this.props.onLogOut();
    }

    render() {
        return (
            <div className={classes.Navbar}>
                <div className={classes.right}>
                    <h2><NavLink to="/">Online Store</NavLink></h2>
                    <NavigationItem link="/Fruit">Fruit</NavigationItem>
                    <NavigationItem link="/Vegetables">Vegetables</NavigationItem>
                    <NavigationItem link="/Bakery">Bakery</NavigationItem>
                    <NavigationItem link="/Frozen">Frozen</NavigationItem>
                </div>
                <div className={classes.left}>
                    <p>{this.props.activeAcc === null ? <NavLink to="/auth">Log on</NavLink> : this.props.activeAcc.userName}</p>
                    <p>{this.props.activeAcc === null ? "" : <NavLink to="/Cart">My Cart({this.props.activeAcc.cart.length})</NavLink>}</p>
                    <p onClick={() => this.logOut()}>Log Off</p>
                </div>

            </div>
        )
    }

}

const mapStateToProps = state => {
    return {
        activeAcc: state.activeUser
    }
}

const mapDispatchToProps = dispatch => {
    return {
        onLogOut: () => dispatch({type: actionTypes.LOGOUT_USER })
    }
}

export default connect(mapStateToProps, mapDispatchToProps)(Navbar);
